import List from './List'
import {styled} from 'styled-components'

const ShoppingListStyles = styled.div`
  display: grid;
  grid-template-columns: 1fr 1fr;



`
export default function ShoppingList() {
  return <ShoppingListStyles>
    <div>
      <List />
    </div>
  </ShoppingListStyles>
}
